class Solution {
public:
    int minSubArrayLen(int target, vector<int>& nums) {
        int n = nums.size();
        int minLen = INT_MAX;
        int sum = 0;
        int left = 0;

        for(int right = 0; right < n; right++){
            sum += nums[right];

            while(sum >= target && left <= right){
                minLen = min(minLen, right - left + 1);
                sum -= nums[left++];
            }
        }

        return minLen == INT_MAX ? 0 : minLen;
    }
};

class Solution {
public:
    int minSubArrayLen(int target, vector<int>& nums) {
        int n = nums.size();
        int left = 0;
        int right = 0;

        int sum = 0;
        int minLen = INT_MAX;

        while(right < n){
            sum += nums[right];

            if(sum < target){
                right++;
            }else if(sum > target){
                while(sum > target){
                    sum -= nums[left++];
                }
                right++;
            }

            if(sum == target){
                int len = right - left;
                minLen = min(minLen, len);
            }
        }
        return minLen != INT_MAX ? minLen : 0;
    }
};

class Solution {
public:
    bool containsNearbyDuplicate(vector<int>& nums, int k) {
        int n = nums.size();
        unordered_map<int,int> mpp;

        for(int i = 0; i < n; i++){
            if(mpp.find(nums[i]) == mpp.end()){
                mpp[nums[i]] = i;
            }else{
                int diff = i - mpp[nums[i]];
                if(diff <= k){
                    return true;
                }else{
                    mpp[nums[i]] = i;
                }
            }
        }
        return false;
    }
};

