class Solution {
public:
    vector<int> twoSum(vector<int>& nums, int target) {
        int n = nums.size();
        unordered_map<int,int> seen;
        int diff;

        for(int i = 0; i < n; i++){
            diff = target - nums[i];
            if(seen.find(diff) != seen.end()){
                return {seen[diff], i};
            }
            seen[nums[i]] = i;
        }

        return {-1,-1};
    }
};

class Solution {
public:
    vector<int> twoSum(vector<int>& nums, int target) {
        int n = nums.size();
        vector<pair<int,int>> numsIdx;
        vector<int> res;

        for(int i = 0; i < n; i++){
            numsIdx.push_back({nums[i], i});
        }

        sort(numsIdx.begin(), numsIdx.end());

        int start = 0;
        int end = n - 1;

        while(start < end){
            int mid = start + (end - start) / 2;
            int sum = numsIdx[start].first + numsIdx[end].first;

            if(sum == target){
                return {numsIdx[start].second, numsIdx[end].second};
            }else if(sum > target){
                end--;
            }else{
                start++;
            }
        }

        return {-1,-1};
    }
};

