class Foo {
    std::mutex mtx;
    std::condition_variable cv;
    int turn = 1;
public:
    void first(std::function<void()> printFirst) {
        std::unique_lock<std::mutex> lock(mtx);
        cv.wait(lock, [&]{ return turn == 1; });
        printFirst();
        turn = 2;
        cv.notify_all();
    }
    void second(std::function<void()> printSecond) {
        std::unique_lock<std::mutex> lock(mtx);
        cv.wait(lock, [&]{ return turn == 2; });
        printSecond();
        turn = 3;
        cv.notify_all();
    }
    void third(std::function<void()> printThird) {
        std::unique_lock<std::mutex> lock(mtx);
        cv.wait(lock, [&]{ return turn == 3; });
        printThird();
    }
};

/**
 * Definition for a binary tree node.
 * struct TreeNode {
 *     int val;
 *     TreeNode *left;
 *     TreeNode *right;
 *     TreeNode() : val(0), left(nullptr), right(nullptr) {}
 *     TreeNode(int x) : val(x), left(nullptr), right(nullptr) {}
 *     TreeNode(int x, TreeNode *left, TreeNode *right) : val(x), left(left), right(right) {}
 * };
 */
class Solution {
    bool mirror(TreeNode* a, TreeNode* b) {
        if (!a || !b) return a == b;
        if (a->val != b->val) return false;
        return mirror(a->left, b->right) && mirror(a->right, b->left);
    }
public:
    bool isSymmetric(TreeNode* root) {
        return mirror(root->left, root->right);
    }
};

/**
 * Definition for a binary tree node.
 * struct TreeNode {
 *     int val;
 *     TreeNode *left;
 *     TreeNode *right;
 *     TreeNode() : val(0), left(nullptr), right(nullptr) {}
 *     TreeNode(int x) : val(x), left(nullptr), right(nullptr) {}
 *     TreeNode(int x, TreeNode *left, TreeNode *right) : val(x), left(left), right(right) {}
 * };
 */
class Solution {
    bool helperFunc(TreeNode* root, TreeNode* min, TreeNode* max){
        if(!root) return true;
        if(min != nullptr && root->val <= min->val){
            return false;
        }
        if(max != nullptr && root->val >= max->val){
            return false;
        }

        return helperFunc(root->left, min, root)
                && helperFunc(root->right, root, max);
    }
public:
    bool isValidBST(TreeNode* root) {
        return helperFunc(root, nullptr, nullptr);
    }
};

