class Solution {
public:
    int removeElement(vector<int>& nums, int val) {
        int len = nums.size();
        int left = 0;
        int right = len - 1;

        while(left <= right){
            if(nums[left] != val){
                left++;
                continue;
            }

            while(right >= left && nums[right] == val){
                right--;
            }

            if(right < left){
                return left;
            }else{
                nums[left++] = nums[right--];
            }
        }
        return left;
    }
};

