        while(cnt != 0 && !st.empty()){
            st.pop();
            cnt--;
        }

        string res;

        while(!st.empty()){
            res += to_string(st.top());
            st.pop();
        }
        reverse(res.begin(), res.end());

        int start = 0;
        while(start < res.length() && res[start] == '0'){
            start++;
        }

        if(start == res.length()){
            return "0";
        }
        return res.substr(start);
    }
};

class Solution {
public:
    double myPow(double x, int n) {
        if(n == 0) return 1.0;
        if(n == 1) return x;
        if(n == -1) return 1.0 / x;

        long long absN = abs((long long)n);  
        double ans;

        if(absN % 2 == 0){
            ans = myPow(x * x, absN / 2);
        } else {
            ans = x * myPow(x * x, (absN - 1) / 2);
        }

        return (n > 0) ? ans : 1.0 / ans;
    }
};

class Solution {
public:
    double myPow(double x, int n) {
        double ans;
        if(n == 1){
            ans = x;
        }else if(n == 0){
            ans = 1;
        }else if(n % 2 == 0){
            ans =  myPow(x * x, abs(n)/2);
        }else{
            ans = x * myPow(x * x, (abs(n) - 1) / 2);
        }

        if(n >= 0){
            return ans;
        }else{
            return 1 / ans;
        }
    }
};

