class Solution {
public:
    int sumSubarrayMins(vector<int>& arr) {
        int len = arr.size();
        long long sum = 0;
        const int MOD = 1e9 + 7;
        stack<pair<int,int>> st;
        vector<int> NseIdx(len, len);
        vector<int> PseIdx(len, -1);

        for(int i = len - 1; i >= 0; i--){
            while(!st.empty() && st.top().first > arr[i]){
                st.pop();
            }

            if(st.empty()){
                st.push({arr[i], i});
            }else{
                NseIdx[i] = st.top().second;
                st.push({arr[i], i});
            }
        }

        while(!st.empty()){
            st.pop();
        }

        for(int i = 0; i < len; i++){
            while(!st.empty() && st.top().first >= arr[i]){
                st.pop();
            }

            if(st.empty()){
                st.push({arr[i], i});
            }else{
                PseIdx[i] = st.top().second;
                st.push({arr[i], i});
            }
        }

        for (int i = 0; i < len; i++) {
            long long left_span = i - PseIdx[i];
            long long right_span = NseIdx[i] - i;
            long long num_subarrays = left_span * right_span;

            long long term_contribution = (long long)arr[i] * num_subarrays;
            sum = (sum + term_contribution) % MOD;
        }

        if (sum < 0) { 
            sum += MOD;
        }
        return static_cast<int>(sum);
    }
};

