class Solution {
public:
    std::vector<int> nextGreaterElements(std::vector<int>& nums) {
        int n = nums.size();
        if (n == 0) {
            return {};
        }

        std::vector<int> result(n, -1); // Initialize results with -1
        std::stack<int> s;              // Stack will store indices of elements from nums

        // Loop effectively twice through the array
        // The first pass (i from 0 to n-1) identifies elements and pushes their indices
        // The second pass (i from n to 2n-1) helps find wrapping NGEs for elements still in stack
        for (int i = 0; i < 2 * n; ++i) {
            int current_num = nums[i % n]; // Current number, handles circularity

            // While stack is not empty and the number at the index on top of stack
            // is smaller than the current number
            while (!s.empty() && nums[s.top()] < current_num) {
                // The number at s.top() has found its next greater element
                result[s.top()] = current_num;
                s.pop(); // Pop it as its NGE is found
            }

            // If we are in the first pass through the original array elements
            if (i < n) {
                // Push the index of the current element onto the stack.
                // These are the elements for which we are seeking an NGE.
                s.push(i);
            }
        }

        // Any indices remaining in the stack do not have a next greater element
        // (they are already initialized to -1 in result).
        return result;
    }
};

