        int start = 0;
        int end = n - 1;
        int minEle = INT_MAX;

        while(start <= end){
            int mid = start + (end - start) / 2;

            if(nums[start] <= nums[mid]){
                minEle = min(minEle,nums[start]);
                start = mid + 1;
            }else{
                minEle = min(minEle,nums[mid]);
                end = mid - 1;
            }
        }
        return minEle;
    }
};

