class Solution {
public:
    int sumOfLeftLeaves(TreeNode* root) {
        // Base Case: If the current node is null, there are no leaves.
        if (root == nullptr) {
            return 0;
        }

        int totalSum = 0;

        // Check if the current node's LEFT child exists AND is a LEAF node.
        if (root->left != nullptr && 
            root->left->left == nullptr && 
            root->left->right == nullptr) {
            // If true, root->left is a "left leaf". Add its value.
            totalSum += root->left->val;
        }

        // Recursively find left leaves in the rest of the left subtree.
        // (The left child itself, if it was a left leaf, has already been counted.
        //  This call is for its children and further descendants).
        totalSum += sumOfLeftLeaves(root->left);

        // Recursively find left leaves in the right subtree.
        totalSum += sumOfLeftLeaves(root->right);

        return totalSum;
    }
};

