            sum += root->val;
        }

        if(root->left != NULL){
            sum += sumOfLeftLeaves(root->left);
        }

        TreeNode* temp = nullptr;
        if(root->right != NULL){
            temp = root->right;
        }

        if(temp != nullptr && (temp->left != NULL || temp->right != NULL)){
            sum += sumOfLeftLeaves(temp);
        }

        return sum;
    }
};

